import { useEffect, useContext } from "react";
import "../index.css";
import "../styles/SubmitData.css";
import { targetContext } from "./Midnight";

function SubmitData() {
  const { targetList, submitData, setSubmitData } = useContext(targetContext);
  useEffect(() => {
    handleLeaderboard();
  }, [targetList]);

  function handleLeaderboard() {
    submitData.map((obj) => {
      if (obj.status === true) {
        console.log("yeeeeep");
        setSubmitData(true);
      }
    });
  }
  return <div className="submit-container"></div>;
}

export default SubmitData;
